import React from "react";
import { Nav, Ul, Li, LinkForLogout, LinkForHome } from "./NavBar.jsx";
import SideNavBar from "./SideTrigger";

const NavBar = props => {
  return (
    <div>
      {!props.isAuthenticated ? (
        <Li>
          <LinkForHome to="/">Home</LinkForHome>
        </Li>
      ) : (
        <Nav>
          <SideTrigger />
          <Ul>
            <Li>
              <LinkForLogout to="/secret" className="link secret-page">
                My Profile
              </LinkForLogout>
            </Li>
            <Li>
              <LinkForLogout to="/logout">Logout</LinkForLogout>
            </Li>
          </Ul>
        </Nav>
      )}
    </div>
  );
};

export default NavBar;
